import React from "react";
import "./Gallery.css";
import df from "../src/images/IMG_20210329_205312_237.jpg";
const Gallery = () => {
  return (
    <>
      <nav id="nav-bar">
        <div class="navbar h-nav .nav-col">
            <ul class="nav-list v-class ">

                <img src={df} alt=""/>
                <a href="./index.html">Home</a>
                <a href="#aboutus">About us</a>
                <a href="">Videos</a>
                <a class="active " href="./gallery.html">Gallery</a>
                <a href="#services">Services</a>
                <a href="./contact.html">Contact us</a>


                <div class="right-nav">
                    <input type="text" placeholder="Search.."/>
                    <button class="btn-bg">Search</button>
                    <button class="btn-bg2">Login</button>
                    <button class="btn-bg2">SignUp</button>
                </div>
            </ul>
            


        </div>
    </nav>
    </>
  );
};
export default Gallery;
